u. O\r\npřesném opaku nás ale přesvědčila loňská sezóna, kdy zazářila dvě jména -\r\nViktória Chladoňová a Lukáš Kubiš. My se dnes ale budeme věnovat pouze druhému\r\njmenovanému. Ten se teprve před třemi měsíci připojil k týmu Unibet Titema\r\nRockets. Kubiš hned v úvodních závodech tohoto roku zaznamenal famózní\r\nvýsledky, čímž si vyjezdil prodloužení smlouvy až do roku 2027!</b></p>\r\n\r\n<p class=\"MsoNormal\">Ještě v roce 2023 Kubiš závodil za slovenský tým Dukla\r\nBanská Bystrica. V tu chvíli to pro něj byla již pátá sezóna v dresu této\r\nslovenské sestavy. <b style=\"mso-bidi-font-weight:normal\">Loňskou sezónu strávil\r\nKubiš v hradeckém týmu Elkov Kasper.</b> Zde zažil průlomovou sezónu, když\r\novládl slovenský národní šampionát. Taktéž se skvěle prezentoval na mistrovství\r\nsvěta a Evropy. <b style=\"mso-bidi-font-weight:normal\">Třešničkou na dortu byly\r\nOlympijské hry, kde zaznamenal výborné 29. místo.</b></p><p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><p></p><div class=\"iframe\"><blockquote class=\"instagram-media\" data-instgrm-permalink=\"https://www.instagram.com/p/C-Kkjy9MYtX/?utm_source=ig_embed&amp;utm_campaign=loading\" data-instgrm-version=\"14\" style=\" background:#FFF; border:0; border-radius:3px; box-shadow:0 0 1px 0 rgba(0,0,0,0.5),0 1px 10px 0 rgba(0,0,0,0.15); margin: 1px; max-width:540px; min-width:326px; padding:0; width:99.375%; width:-webkit-calc(100% - 2px); width:calc(100% - 2px);\"><div style=\"padding:16px;\"> <a href=\"https://www.instagram.com/p/C-Kkjy9MYtX/?utm_source=ig_embed&amp;utm_campaign=loading\" style=\" background:#FFFFFF; line-height:0; padding:0 0; text-align:center; text-decoration:none; width:100%;\" target=\"_blank\"> <div style=\" display: flex; flex-direction: row; align-items: center;\"> <div style=\"background-color: #F4F4F4; border-radius: 50%; flex-grow: 0; height: 40px; margin-right: 14px; width: 40px;\"></div> <div style=\"display: flex; flex-direction: column; flex-grow: 1; 