: 50%; flex-grow: 0; height: 20px; width: 20px;\"></div> <div style=\" width: 0; height: 0; border-top: 2px solid transparent; border-left: 6px solid #f4f4f4; border-bottom: 2px solid transparent; transform: translateX(16px) translateY(-4px) rotate(30deg)\"></div></div><div style=\"margin-left: auto;\"> <div style=\" width: 0px; border-top: 8px solid #F4F4F4; border-right: 8px solid transparent; transform: translateY(16px);\"></div> <div style=\" background-color: #F4F4F4; flex-grow: 0; height: 12px; width: 16px; transform: translateY(-4px);\"></div> <div style=\" width: 0; height: 0; border-top: 8px solid #F4F4F4; border-left: 8px solid transparent; transform: translateY(-4px) translateX(8px);\"></div></div></div> <div style=\"display: flex; flex-direction: column; flex-grow: 1; justify-content: center; margin-bottom: 24px;\"> <div style=\" background-color: #F4F4F4; border-radius: 4px; flex-grow: 0; height: 14px; margin-bottom: 6px; width: 224px;\"></div> <div style=\" background-color: #F4F4F4; border-radius: 4px; flex-grow: 0; height: 14px; width: 144px;\"></div></div></a><p style=\" color:#c9c8cd; font-family:Arial,sans-serif; font-size:14px; line-height:17px; margin-bottom:0; margin-top:8px; overflow:hidden; padding:8px 0 7px; text-align:center; text-overflow:ellipsis; white-space:nowrap;\"><a href=\"https://www.instagram.com/p/DHlfd1INAXw/?utm_source=ig_embed&amp;utm_campaign=loading\" style=\" color:#c9c8cd; font-family:Arial,sans-serif; font-size:14px; font-style:normal; font-weight:normal; line-height:17px; text-decoration:none;\" target=\"_blank\">Příspěvek sdílený Unibet Tietema Rockets (@rocketscycling)</a></p></div></blockquote> <script async=\"\" src=\"//www.instagram.com/embed.js\"></script></div><br></b></p>\r\n\r\n<p class=\"MsoNormal\">Tyto skvělé výsledky slovenskému reprezentantovi vynesly\r\nvelkou mediální pozornost<b style=\"mso-bidi-font-weight:normal\">. Kubiš se stal\r\nhlavní tváří sociálních sítí týmu Titema Rockets.</b> I díky tomu se tým\r\nrozhodl, že mu prodlouží smlouvu až do roku 2027. Slovákova nová <b style=\"mso-bidi-font-weight:normal\">smlouva obsahuje i zvláštní klauzuli, která\r\nse aktivuje, pokud vyhraje Paris-Roubaix. </b>V tom případě obdrží od týmu jako\r\nprémii <b style=\"mso-bidi-font-weight:normal\">1000 belgických koláčků zvaných\r\nMattentaartjes.</b></p><p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><p><p></p><div class=\"iframe\"><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/4mbINCUKDF4?si=YHYG4fMnPTNsI5XK\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" referrerpolicy=\"strict-origin-when-cross-origin\" allowfullscreen=\"\"></iframe></div></p><br></b></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">Co říkáte na Kubišovy\r\nvýkony?</b></p>\r\n\r\n<div><br></div>', 6, 'lukas-kubis-po-skvelych-vykonech-prodlouzil-smlouvu-s-tymem-unibet-do-roku-2027');
