 Table 4 Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"51\"\r\n   Name=\"List Table 6 Colorful Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"52\"\r\n   Name=\"List Table 7 Colorful Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"46\"\r\n   Name=\"List Table 1 Light Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"47\" Name=\"List Table 2 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"48\" Name=\"List Table 3 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"49\" Name=\"List Table 4 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"51\"\r\n   Name=\"List Table 6 Colorful Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"52\"\r\n   Name=\"List Table 7 Colorful Accent 6\"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!--[if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:\"Normální tabulka\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:8.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:107%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:\"Calibri\",sans-serif;\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:\"Times New Roman\";\r\n	mso-bidi-theme-font:minor-bidi;\r\n	mso-fareast-language:EN-US;}\r\n</style>\r\n<![endif]-->\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">Asi každý cyklistický\r\nfanoušek zachytil výsledek nedávno proběhnuvšího monumentu Milano-Sanremo.\r\nTadej Pogačar na něm dojel na 3. místě, což pro něj bylo zklamání. Tento\r\nitalský monument mu totiž v jeho palmáres schází. Z pěti monumentů doposud\r\nslovinský fenomén nevyhrál už jen Paris-Roubaix, na němž ještě nikdy\r\nnestartoval. To se ale letos změní. Tadej Pogačar se totiž 13. dubna postaví na\r\nstart Pekla Severu!</b></p>\r\n\r\n<p class=\"MsoNormal\">Již na začátku této sezóny <b style=\"mso-bidi-font-weight:\r\nnormal\">Tadej zveřejnil na svém instagramu fotku, která pobouřila internet</b>.\r\nZ&nbsp;obrázků <span style=\"mso-spacerun:yes\">&nbsp;</span>bylo zřejmé, že si byl\r\nprojíždět trasu Paris-Roubaix. V tu chvíli ale tento závod v jeho kalendáři\r\nnefiguroval, takže se <b style=\"mso-bidi-font-weight:normal\">začalo spekulovat,\r\nzdali se přeci jen na start Pekla Severu nepostaví</b>.</p><p class=\"MsoNormal\"></p><p></p><div class=\"iframe\"><blockquote class=\"twitter-tweet\"><p lang=\"und\" dir=\"ltr\">OFFICIAL: Tadej Pogačar will ride Paris Roubaix 😍 <a href=\"https://t.co/5t1xiIz0jX\">https://t.co/5t1xiIz0jX</a> <a href=\"https://t.co/FkpWBtgtgf\">pic.twitter.com/FkpWBtgtgf</a></p>— Lukáš Ronald Lukács (@lucasaganronald) <a href=\"https://twitter.com/lucasaganronald/status/1904823872383229985?ref_src=twsrc%5Etfw\">March 26, 2025</a></blockquote> <script async=\"\" src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script> </div><br><p></p><p class=\"MsoNormal\"></p><p></p><p></p>\r\n\r\n<p class=\"MsoNormal\">Z&nbsp;nedávných vyjádření Pogačara a jeho týmu bylo cítit,\r\nže Slovinec se na start Pekla Severu chce postavit, ale <b style=\"mso-bidi-font-weight:\r\nnormal\">jeho tým se mu to snažil rozmluvit</b>. Paris-Roubaix je totiž z\r\nhlediska pádů jeden z nejnebezpečnějších závodů. Slovincův <b style=\"mso-bidi-font-weight:\r\nnormal\">tým UAE Emirates tak nechtěl riskovat zranění své nejlepší hvězdy.</b>\r\nPřípadné zranění by totiž mohlo narušit přípravu na Tour de France, což tým\r\npovažuje za vrchol sezóny.</p>\r\n\r\n<p class=\"MsoNormal\">Pogačar se ale nakonec se svým týmem dohodl na konsenzu. Ze\r\nsvého původního programu odstranil klasiky E3 Saxo a Gent-Wevelgem. Místo nich <b style=\"mso-bidi-font-weight:normal\">bylo Pogačarovi umožněno startovat na\r\nParis-Roubiax</b>. V programu rovněž zůstal monument Okolo Flander. <b style=\"mso-bidi-font-weight:normal\">Slovinskou hvězdu tak letos uvidíme na\r\nvšech pěti monumentech!</b></p><p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"></b></p><p></p><div class=\"iframe\"><iframe src=\"https://www.facebook.com/plugins/post.php?href=https%3A%2F%2Fwww.facebook.com%2Fcyclingnews%2Fposts%2Fpfbid02nX9BnwiKNefCPdpVoUKnhSjW7vpsFDXQFhSntJKC4iDgQQpLHd8DcagstbXXqA85l&amp;show_text=true&amp;width=500\" width=\"500\" height=\"615\" style=\"border:none;overflow:hidden\" scrolling=\"no\" frameborder=\"0\" allowfullscreen=\"true\" allow=\"autoplay; clipboard-write; encrypted-media; picture-in-picture; web-share\"></iframe></div><b style=\"mso-bidi-font-weight:normal\"><br></b><p></p><p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"></b></p><p></p><p></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">Myslíte si, že\r\nPogačar vyhraje Paris-Roubaix?</b></p><p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><br></b></p>\r\n\r\n<p class=\"MsoNormal\">zdroj: uaeteamemirates.com</p>\r\n\r\n            ', 6, 'a-je-to-oficialni-tadej-pogacar-letos-pojede-paris-roubaix');
