(3, 'dominiknousek@gmail.com', '$2y$10$InPZA7Bst8U8.R7n8WelHOR5OzbmR455Y2/bAH5crQKtmjguB4FFW', 2, 'Dominik', 'Petrnoušek', 'IMG_3510.JPG', 'Do 15 jsem byl tlustej kluk u počítače. Pak jsem objevil kolo. Brzo jsem ale pochopil, že moje výkony mě vážně neuživí. Tak jsem si z toho radši začal dělat srandu na internetu. A tak vznikl Cyklistickey', '1999-12-07'),
(4, 'honza-valis@seznam.cz', '$2y$10$5djj63Foflta4F9Ol7FKW.8V3NQNA5xYkDP8xr9ElNmLGh.ExU5da', 1, 'Honza', 'Vališ', '1000006372.jpg', 'Dříč. Garderobiér. Toho času na off season. ', '0000-00-00'),
(5, 'vojta.dusanek@seznam.cz', '$2y$10$8FA3rPlaGRIQQRIxG5vbIefpXEvqfmgNqNE3l4wZwE2ZKTXaVwgj.', 1, 'Vojtěch', 'Dušánek', 'DSCN5640.JPG', 'Jmenuju se sice Vojta, ale v redakci mi nikdo neřekne jinak než Véna. Kolo mě provází vedle dalších sportů od útlého dětství, nicméně v posledních pár letech jsem tomu propadl úplně. Na Cyklistickým se věnuji hlavně psaní článků.', '2006-05-31'),
(6, 'vojta.dusanek@seznam.cz', '$2y$10$8FA3rPlaGRIQQRIxG5vbIefpXEvqfmgNqNE3l4wZwE2ZKTXaVwgj.', 1, 'Vojtěch', 'Dušánek', 'DSCN5640.JPG', 'Jmenuju se sice Vojta, ale v redakci mi nikdo neřekne jinak než Véna. Kolo mě provází vedle dalších sportů od útlého dětství, nicméně v posledních pár letech jsem tomu propadl úplně. Na Cyklistickým se věnuji hlavně psaní článků.', '2006-05-31'),
(7, 'halasv17@gmail.com', '$2y$10$16olSu9fJcpag3v2YEz/ReMHWMQrRWgIk7HoKaKm5gVQl402kXsFy', 1, 'Václav', 'Halás', '1000004907.jpg', 'Ano, taky zbožňuji cyklistiku, jako všichni, kteří navštěvují tenhle web. Ale pozor, některé její odvětví mám radši než ty ostatní. Sám jsem závodníkem a rád se porovnávám s ostatními v maratonských závodech. Naopak enduro a downhill jsou pro mě španělskou vesnicí.', '2007-04-27'),
(8, 'steveosyka@gmail.com', '$2y$10$apu42E.qtY7ikYJljAan7.a7RwxW0R9jMHH5FHl7dpu9g33/NLz0u', 2, 'Steve', 'Osyka', 'unnamed.jpg', 'Cokoliv je na webu špatně, jde za Ondřejem', '2005-10-20'),
(9, 'tjomj285@gmail.com', '$2y$10$yoN8gv2A9aFDvniIC2gqdeYHFnrtXxc6rKdOZHFwo9qewfIVlGeLe', 1, 'Tomáš', 'Janoušek', '317139700_201818415634855_4413269477632676061_n.jpg', 'Prostě Tomáš ze ShredShow 😏', '2005-05-28'),
(12, 'admin@cyklistickey.cz', '$2y$10$3OBC1VNalqPC71i/DZqn6.V453K/fprJRvJYtxV21rMYLtNMq8Z4m', 3, 'Admin', 'Cyklistickey', '', '', NULL),
(13, 'editor@cyklistickey.cz', '$2y$10$cQYITl5/vYk.PNU5wDJ0HObGPJMs.gRY8G03ffpFkeGOsI908.7X.', 2, 'Editor', 'Cyklistickey', '', '', NULL),
